{
	const scriptsInEvents = {

		async EventSheet1_Event3_Act2(runtime, localVars)
		{
			const srsearch = localVars.srsearch;
			const wikiSearchResult = await wiki.wikiSearchQuery(
			  { language: "en", srsearch: srsearch, srlimit: 15 },
			);
			
			runtime.globalVars.wikiURL = wikiSearchResult;
			
		},

		async EventSheet1_Event4_Act1(runtime, localVars)
		{
			const uid = localVars.UID;
			const color = localVars.Color;
			const text = g_runtime.getInstanceByUid(uid);
			
			text.colorRgb = c3_colorjs.hexToRGBA(color, {formatNumber: "0-1 Range", formatReturn: "Array"});
		}

	};
	
	self.C3.ScriptsInEvents = scriptsInEvents;
}


// User script Script.js

let wiki;
let c3_colorjs;


runOnStartup(async runtime =>
{
	globalThis.g_runtime  =  runtime;
	wiki = await loadModule(runtime, 'wiki.js');
	c3_colorjs = await loadModuleURL(runtime, 'https://c3demo.stranianelli.com/javascript/000-snippets/c3_colors_helper.js');
});


async function loadModule(runtime, name) {
	const isPreview = window.location.href === `https://preview.construct.net/local/index.html`;
	const file = isPreview ? await runtime.assets.getProjectFileUrl(name) : `../${name}`;
    const mod = await import(file);
	return mod;
}

async function loadModuleURL(runtime, name) {
    const mod = await import(name);
	return mod;
}



